import countries from 'world-countries'

const CountryInfo = (countries) => {
  console.log(countries)
  return (
    <h1>Hello, {countries.name}</h1>
  )
}

const App = (props) => {
  return (
    <div>
      <CountryInfo data={countries[0]} />
    </div>
  )
}

export default App
